"use strict";(self.webpackChunk_N_E=self.webpackChunk_N_E||[]).push([[9570],{10143:function(e,i,a){a.d(i,{appConfig:function(){return n}});let n={i18n:{locales:["en","es","fr","de","pt","zh","zh-TW","ar","ru","it","ja","ko"],defaultLocale:"en",localeLabels:{en:"English",es:"Espa\xf1ol",de:"Deutsch",fr:"Fran\xe7ais",it:"Italiano",pt:"Portugu\xeas",zh:"简体中文","zh-TW":"繁體中文",ar:"العربية",ru:"Русский",bn:"বাংলা",ja:"日本語",ko:"한국어",id:"Bahasa Indonesia"},localeCurrencies:{en:"USD",de:"USD",es:"USD",fr:"USD",it:"USD",pt:"USD",zh:"USD",ar:"USD",ru:"USD",bn:"USD",ja:"USD",ko:"USD",id:"USD"}},auth:{oAuthProviders:["google"]},zhAuth:{oAuthProviders:["microsoft","google"]},marketing:{menu:[{translationKey:"pricing",href:"/pricing"},{translationKey:"blog",href:"/Blog"}]}}},97528:function(e,i,a){a.d(i,{jD:function(){return o},rU:function(){return c}});var n=a(83009),t=a(10143);let{Link:r,redirect:s,usePathname:o,useRouter:l}=(0,a(8693).iV)({locales:t.appConfig.i18n.locales,localePrefix:"never"});function c(e){let{prefetch:i=!1,...a}=e;return(0,n.jsx)(r,{...a,prefetch:i})}},58960:function(e,i,a){a.d(i,{nN:function(){return r},dk:function(){return o},z3:function(){return s}});let n={en:{"animation-illustration":{name:"Animation & Illustration",description:"Animation & Illustration merges dynamic movement with artistic detail, creating vibrant visuals that tell stories and capture emotions. This style breathes life into static images, from whimsical characters to fantastical landscapes. Explore our curated collection of image prompts to inspire your ideas and unlock new creative possibilities."},"sci-fi-fantasy":{name:"Sci-Fi & Fantasy",description:"Sci-Fi & Fantasy transports us to imaginative worlds filled with advanced technology, mythical creatures, and extraordinary adventures. This style blends futuristic elements with magical realism, allowing for limitless creativity and exploration of the unknown. Dive into our collection of image prompts to spark your imagination and inspire your next creative endeavor."},perspective:{name:"Perspective",description:"Perspective refers to the way we see and interpret the world around us. It can change how we understand and engage with different subjects, offering new insights and viewpoints. Explore our collection of image prompts to inspire your creativity and broaden your perspective."},"traditional-cultural":{name:"Traditional & Cultural",description:"Traditional & Cultural art reflects the rich history and diverse customs of various societies. This style emphasizes the beauty of cultural expressions, from intricate patterns to symbolic motifs, preserving the essence of heritage. Explore our collection of image prompts to inspire your creativity and connect with the stories and traditions that shape our world."},game:{name:"Game",description:"Game art captures the essence of interactive experiences, blending creativity with technology to create immersive worlds. This style encompasses various genres, from action-packed adventures to strategic puzzles, inviting players to explore, compete, and collaborate. Discover our collection of image prompts designed to inspire your game related AI image generation."},"modern-abstract":{name:"Modern & Abstract",description:"Modern & Abstract art challenges conventional forms and encourages innovative expression through bold colors, shapes, and concepts. This style emphasizes creativity over realism, inviting viewers to interpret meaning in unique ways. Explore our collection of image prompts to inspire your artistic journey and push the limits of your imagination."},"design-commercial":{name:"Design & Commercial",description:"Design & Commercial art focuses on creating visually striking imagery for commercial applications. This style combines aesthetic principles with marketing strategies to produce eye-catching designs that capture attention and convey a message effectively. From vibrant product packaging to impactful advertising campaigns, Design & Commercial art leverages creativity to drive commercial success. Explore our collection of image prompts to inspire your AI image generation and learn how to craft visuals that leave a lasting impression."},"photography-realism":{name:"Photography & Realism",description:"Photography & Realism focuses on portraying subjects with striking accuracy and detail, reflecting the world as it is. This style emphasizes natural light, composition, and the subtleties of human experience, creating powerful visual narratives. Explore our collection of image prompts to inspire your photography style image generation and enhance your ability to capture authentic moments and emotions."},"historical-art-movement":{name:"Historical & Art Movement",description:"Historical & Art Movement art explores the evolution of artistic styles and cultural expressions throughout history. This style reflects the influences of various movements, from Renaissance to Modernism, showcasing how art has shaped and been shaped by societal changes. Delve into our collection of image prompts to inspire your understanding of art's rich heritage and its ongoing dialogue with contemporary creativity."}},zh:{"animation-illustration":{name:"动画与插画",description:"动画与插画将动态运动与艺术细节融合，创造出生动的视觉效果，讲述故事并捕捉情感。这种风格为静态图片注入生命，从异想天开的角色到奇幻的景观。探索我们精心策划的图片提示词集合，激发您的创意并开启新的创作可能性。"},"sci-fi-fantasy":{name:"科幻与奇幻",description:"科幻与奇幻将我们带入充满先进技术、神话生物和非凡冒险的想象世界。这种风格将未来元素与魔幻现实主义相结合，允许无限的创造力和对未知的探索。深入我们的图片提示词集合，激发您的想象力，启发您的下一个创意项目。"},perspective:{name:"视角",description:"视角指的是我们观察和解读周围世界的方式。它可以改变我们对不同主题的理解和互动方式，提供新的见解和观点。探索我们的图片提示词集合，激发您的创意并拓宽您的视角。"},"traditional-cultural":{name:"传统与文化",description:"传统与文化艺术反映了各个社会丰富的历史和多样的习俗。这种风格强调文化表达的美，从复杂的图案到象征性的主题，保存了文化遗产的精髓。探索我们的图片提示词集合，激发您的创造力，并与塑造我们世界的故事和传统建立联系。"},game:{name:"游戏",description:"游戏艺术捕捉了互动体验的精髓，将创造力与技术融合，创造出沉浸式的世界。这种风格涵盖了各种类型，从充满动作的冒险到策略性的解谜，邀请玩家探索、竞争和合作。探索我们的图片提示词集合，设计用于启发您的游戏相关AI图片生成。"},"modern-abstract":{name:"现代与抽象",description:"现代与抽象艺术挑战传统形式，通过大胆的色彩、形状和概念鼓励创新表达。这种风格强调创造力而非现实主义，邀请观者以独特的方式解读意义。探索我们的图片提示词集合，激发您的艺术之旅，并推动您想象力的极限。"},"design-commercial":{name:"设计与商业",description:"设计与商业艺术专注于为商业应用创造视觉冲击力强的图片。这种风格将美学原则与营销策略相结合，制作出吸引眼球的设计，有效地捕捉注意力并传达信息。从鲜明的产品包装到有影响力的广告活动，设计与商业艺术利用创造力推动商业成功。探索我们的图片提示词集合，激发您的AI图片生成，并学习如何制作留下持久印象的视觉效果。"},"photography-realism":{name:"摄影与现实主义",description:"摄影与现实主义专注于以惊人的准确性和细节描绘主题，反映真实世界。这种风格强调自然光线、构图和人类经验的微妙之处，创造出强大的视觉叙事。探索我们的图片提示词集合，激发您的摄影风格图片生成，并增强您捕捉真实瞬间和情感的能力。"},"historical-art-movement":{name:"历史与艺术运动",description:"历史与艺术运动艺术探索了艺术风格和文化表达在历史长河中的演变。这种风格反映了从文艺复兴到现代主义等各种运动的影响，展示了艺术如何塑造社会变革并被社会变革所塑造。深入我们的图片提示词集合，激发您对艺术丰富遗产的理解，以及它与当代创造力的持续对话。"}},de:{"animation-illustration":{name:"Animation & Illustration",description:"Animation & Illustration verbindet dynamische Bewegung mit k\xfcnstlerischen Details und schafft lebendige Bilder, die Geschichten erz\xe4hlen und Emotionen einfangen. Dieser Stil haucht statischen Bildern Leben ein, von skurrilen Charakteren bis hin zu fantastischen Landschaften. Entdecken Sie unsere kuratierte Sammlung von Bildvorgaben, um Ihre Ideen zu inspirieren und neue kreative M\xf6glichkeiten zu erschlie\xdfen."},"sci-fi-fantasy":{name:"Sci-Fi & Fantasy",description:"Sci-Fi & Fantasy entf\xfchrt uns in fantasievolle Welten voller fortschrittlicher Technologie, mythischer Kreaturen und au\xdfergew\xf6hnlicher Abenteuer. Dieser Stil verbindet futuristische Elemente mit magischem Realismus und erm\xf6glicht grenzenlose Kreativit\xe4t und Erkundung des Unbekannten. Tauchen Sie in unsere Sammlung von Bildvorgaben ein, um Ihre Fantasie zu befl\xfcgeln und Ihr n\xe4chstes kreatives Projekt zu inspirieren."},perspective:{name:"Perspektive",description:"Perspektive bezieht sich auf die Art und Weise, wie wir die Welt um uns herum sehen und interpretieren. Sie kann ver\xe4ndern, wie wir verschiedene Themen verstehen und damit umgehen, und bietet neue Einsichten und Blickwinkel. Entdecken Sie unsere Sammlung von Bildvorgaben, um Ihre Kreativit\xe4t zu inspirieren und Ihre Perspektive zu erweitern."},"traditional-cultural":{name:"Traditionell & Kulturell",description:"Traditionelle & Kulturelle Kunst spiegelt die reiche Geschichte und die vielf\xe4ltigen Br\xe4uche verschiedener Gesellschaften wider. Dieser Stil betont die Sch\xf6nheit kultureller Ausdrucksformen, von komplizierten Mustern bis hin zu symbolischen Motiven, und bewahrt das Wesen des Erbes. Entdecken Sie unsere Sammlung von Bildvorgaben, um Ihre Kreativit\xe4t zu inspirieren und eine Verbindung zu den Geschichten und Traditionen herzustellen, die unsere Welt pr\xe4gen."},game:{name:"Spiel",description:"Spielkunst f\xe4ngt das Wesen interaktiver Erlebnisse ein und verbindet Kreativit\xe4t mit Technologie, um immersive Welten zu schaffen. Dieser Stil umfasst verschiedene Genres, von actiongeladenen Abenteuern bis hin zu strategischen R\xe4tseln, und l\xe4dt die Spieler ein, zu erkunden, zu konkurrieren und zusammenzuarbeiten. Entdecken Sie unsere Sammlung von Bildvorgaben, die entwickelt wurden, um Ihre spielbezogene KI-Bilderzeugung zu inspirieren."},"modern-abstract":{name:"Modern & Abstrakt",description:"Moderne & Abstrakte Kunst stellt konventionelle Formen in Frage und f\xf6rdert innovative Ausdrucksformen durch kr\xe4ftige Farben, Formen und Konzepte. Dieser Stil betont Kreativit\xe4t \xfcber Realismus und l\xe4dt die Betrachter ein, Bedeutung auf einzigartige Weise zu interpretieren. Entdecken Sie unsere Sammlung von Bildvorgaben, um Ihre k\xfcnstlerische Reise zu inspirieren und die Grenzen Ihrer Vorstellungskraft zu erweitern."},"design-commercial":{name:"Design & Kommerziell",description:"Design & Kommerzielle Kunst konzentriert sich auf die Schaffung visuell auff\xe4lliger Bilder f\xfcr kommerzielle Anwendungen. Dieser Stil kombiniert \xe4sthetische Prinzipien mit Marketingstrategien, um auff\xe4llige Designs zu produzieren, die Aufmerksamkeit erregen und eine Botschaft effektiv vermitteln. Von lebendiger Produktverpackung bis hin zu wirkungsvollen Werbekampagnen nutzt Design & Kommerzielle Kunst Kreativit\xe4t, um kommerziellen Erfolg zu erzielen. Entdecken Sie unsere Sammlung von Bildvorgaben, um Ihre KI-Bilderzeugung zu inspirieren und zu lernen, wie man visuelle Effekte erstellt, die einen bleibenden Eindruck hinterlassen."},"photography-realism":{name:"Fotografie & Realismus",description:"Fotografie & Realismus konzentriert sich auf die Darstellung von Motiven mit beeindruckender Genauigkeit und Detailtreue und spiegelt die Welt wider, wie sie ist. Dieser Stil betont nat\xfcrliches Licht, Komposition und die Feinheiten menschlicher Erfahrung und schafft kraftvolle visuelle Erz\xe4hlungen. Entdecken Sie unsere Sammlung von Bildvorgaben, um Ihre fotografische Stilbilderzeugung zu inspirieren und Ihre F\xe4higkeit zu verbessern, authentische Momente und Emotionen einzufangen."},"historical-art-movement":{name:"Historisch & Kunstbewegung",description:"Historische & Kunstbewegungskunst erforscht die Entwicklung k\xfcnstlerischer Stile und kultureller Ausdrucksformen im Laufe der Geschichte. Dieser Stil spiegelt die Einfl\xfcsse verschiedener Bewegungen wider, von der Renaissance bis zur Moderne, und zeigt, wie Kunst gesellschaftliche Ver\xe4nderungen gepr\xe4gt hat und von ihnen gepr\xe4gt wurde. Tauchen Sie in unsere Sammlung von Bildvorgaben ein, um Ihr Verst\xe4ndnis f\xfcr das reiche Erbe der Kunst und ihren fortlaufenden Dialog mit zeitgen\xf6ssischer Kreativit\xe4t zu inspirieren."}},es:{"animation-illustration":{name:"Animaci\xf3n e Ilustraci\xf3n",description:"La Animaci\xf3n e Ilustraci\xf3n fusiona el movimiento din\xe1mico con el detalle art\xedstico, creando visuales vibrantes que cuentan historias y capturan emociones. Este estilo da vida a im\xe1genes est\xe1ticas, desde personajes caprichosos hasta paisajes fant\xe1sticos. Explora nuestra colecci\xf3n curada de indicaciones de im\xe1genes para inspirar tus ideas y desbloquear nuevas posibilidades creativas."},"sci-fi-fantasy":{name:"Ciencia Ficci\xf3n y Fantas\xeda",description:"La Ciencia Ficci\xf3n y Fantas\xeda nos transporta a mundos imaginativos llenos de tecnolog\xeda avanzada, criaturas m\xedticas y aventuras extraordinarias. Este estilo mezcla elementos futuristas con realismo m\xe1gico, permitiendo una creatividad ilimitada y la exploraci\xf3n de lo desconocido. Sum\xe9rgete en nuestra colecci\xf3n de indicaciones de im\xe1genes para despertar tu imaginaci\xf3n e inspirar tu pr\xf3ximo esfuerzo creativo."},perspective:{name:"Perspectiva",description:"La perspectiva se refiere a la forma en que vemos e interpretamos el mundo que nos rodea. Puede cambiar la forma en que entendemos y nos relacionamos con diferentes temas, ofreciendo nuevas ideas y puntos de vista. Explora nuestra colecci\xf3n de indicaciones de im\xe1genes para inspirar tu creatividad y ampliar tu perspectiva."},"traditional-cultural":{name:"Tradicional y Cultural",description:"El arte Tradicional y Cultural refleja la rica historia y las diversas costumbres de varias sociedades. Este estilo enfatiza la belleza de las expresiones culturales, desde patrones intrincados hasta motivos simb\xf3licos, preservando la esencia del patrimonio. Explora nuestra colecci\xf3n de indicaciones de im\xe1genes para inspirar tu creatividad y conectar con las historias y tradiciones que dan forma a nuestro mundo."},game:{name:"Juego",description:"El arte de los juegos captura la esencia de las experiencias interactivas, mezclando creatividad con tecnolog\xeda para crear mundos inmersivos. Este estilo abarca varios g\xe9neros, desde aventuras llenas de acci\xf3n hasta rompecabezas estrat\xe9gicos, invitando a los jugadores a explorar, competir y colaborar. Descubre nuestra colecci\xf3n de indicaciones de im\xe1genes dise\xf1adas para inspirar tu generaci\xf3n de im\xe1genes de IA relacionadas con juegos."},"modern-abstract":{name:"Moderno y Abstracto",description:"El arte Moderno y Abstracto desaf\xeda las formas convencionales y fomenta la expresi\xf3n innovadora a trav\xe9s de colores audaces, formas y conceptos. Este estilo enfatiza la creatividad sobre el realismo, invitando a los espectadores a interpretar el significado de maneras \xfanicas. Explora nuestra colecci\xf3n de indicaciones de im\xe1genes para inspirar tu viaje art\xedstico y empujar los l\xedmites de tu imaginaci\xf3n."},"design-commercial":{name:"Dise\xf1o y Comercial",description:"El arte de Dise\xf1o y Comercial se centra en crear im\xe1genes visualmente impactantes para aplicaciones comerciales. Este estilo combina principios est\xe9ticos con estrategias de marketing para producir dise\xf1os llamativos que capturan la atenci\xf3n y transmiten un mensaje de manera efectiva. Desde empaques de productos vibrantes hasta campa\xf1as publicitarias impactantes, el arte de Dise\xf1o y Comercial aprovecha la creatividad para impulsar el \xe9xito comercial. Explora nuestra colecci\xf3n de indicaciones de im\xe1genes para inspirar tu generaci\xf3n de im\xe1genes de IA y aprender c\xf3mo crear visuales que dejen una impresi\xf3n duradera."},"photography-realism":{name:"Fotograf\xeda y Realismo",description:"La Fotograf\xeda y el Realismo se centran en retratar sujetos con una precisi\xf3n y detalle sorprendentes, reflejando el mundo tal como es. Este estilo enfatiza la luz natural, la composici\xf3n y las sutilezas de la experiencia humana, creando poderosas narrativas visuales. Explora nuestra colecci\xf3n de indicaciones de im\xe1genes para inspirar tu generaci\xf3n de im\xe1genes de estilo fotogr\xe1fico y mejorar tu capacidad para capturar momentos y emociones aut\xe9nticos."},"historical-art-movement":{name:"Movimiento Hist\xf3rico y Art\xedstico",description:"El arte del Movimiento Hist\xf3rico y Art\xedstico explora la evoluci\xf3n de los estilos art\xedsticos y las expresiones culturales a lo largo de la historia. Este estilo refleja las influencias de varios movimientos, desde el Renacimiento hasta el Modernismo, mostrando c\xf3mo el arte ha dado forma y ha sido moldeado por los cambios sociales. Sum\xe9rgete en nuestra colecci\xf3n de indicaciones de im\xe1genes para inspirar tu comprensi\xf3n del rico patrimonio del arte y su di\xe1logo continuo con la creatividad contempor\xe1nea."}},fr:{"animation-illustration":{name:"Animation et Illustration",description:"L'animation et l'illustration fusionnent le mouvement dynamique avec le d\xe9tail artistique, cr\xe9ant des visuels vibrants qui racontent des histoires et capturent des \xe9motions. Ce style insuffle la vie aux images statiques, des personnages fantaisistes aux paysages fantastiques. Explorez notre collection de suggestions d'images pour inspirer vos id\xe9es et d\xe9bloquer de nouvelles possibilit\xe9s cr\xe9atives."},"sci-fi-fantasy":{name:"Science-Fiction et Fantaisie",description:"La science-fiction et la fantaisie nous transportent dans des mondes imaginatifs remplis de technologies avanc\xe9es, de cr\xe9atures mythiques et d'aventures extraordinaires. Ce style m\xe9lange des \xe9l\xe9ments futuristes avec le r\xe9alisme magique, permettant une cr\xe9ativit\xe9 sans limites et l'exploration de l'inconnu. Plongez dans notre collection de suggestions d'images pour stimuler votre imagination et inspirer votre prochaine cr\xe9ation."},perspective:{name:"Perspective",description:"La perspective se r\xe9f\xe8re \xe0 la mani\xe8re dont nous voyons et interpr\xe9tons le monde qui nous entoure. Elle peut changer notre compr\xe9hension et notre interaction avec diff\xe9rents sujets, offrant de nouvelles id\xe9es et points de vue. Explorez notre collection de suggestions d'images pour inspirer votre cr\xe9ativit\xe9 et \xe9largir votre perspective."},"traditional-cultural":{name:"Traditionnel et Culturel",description:"L'art traditionnel et culturel refl\xe8te la riche histoire et les coutumes diverses de diff\xe9rentes soci\xe9t\xe9s. Ce style met en valeur la beaut\xe9 des expressions culturelles, des motifs complexes aux symboles, pr\xe9servant l'essence du patrimoine. Explorez notre collection de suggestions d'images pour inspirer votre cr\xe9ativit\xe9 et vous connecter aux histoires et traditions qui fa\xe7onnent notre monde."},game:{name:"Jeu",description:"L'art du jeu capture l'essence des exp\xe9riences interactives, m\xe9langeant cr\xe9ativit\xe9 et technologie pour cr\xe9er des mondes immersifs. Ce style englobe divers genres, des aventures pleines d'action aux puzzles strat\xe9giques, invitant les joueurs \xe0 explorer, rivaliser et collaborer. D\xe9couvrez notre collection de suggestions d'images con\xe7ues pour inspirer votre g\xe9n\xe9ration d'images IA li\xe9es aux jeux."},"modern-abstract":{name:"Moderne et Abstrait",description:"L'art moderne et abstrait d\xe9fie les formes conventionnelles et encourage l'expression innovante \xe0 travers des couleurs audacieuses, des formes et des concepts. Ce style met l'accent sur la cr\xe9ativit\xe9 plut\xf4t que sur le r\xe9alisme, invitant les spectateurs \xe0 interpr\xe9ter le sens de mani\xe8re unique. Explorez notre collection de suggestions d'images pour inspirer votre parcours artistique et repousser les limites de votre imagination."},"design-commercial":{name:"Design et Commercial",description:"L'art du design et commercial se concentre sur la cr\xe9ation d'images visuellement frappantes pour des applications commerciales. Ce style combine des principes esth\xe9tiques avec des strat\xe9gies marketing pour produire des designs accrocheurs qui captent l'attention et transmettent un message efficacement. Des emballages de produits vibrants aux campagnes publicitaires percutantes, l'art du design et commercial utilise la cr\xe9ativit\xe9 pour favoriser le succ\xe8s commercial. Explorez notre collection de suggestions d'images pour inspirer votre g\xe9n\xe9ration d'images IA et apprendre \xe0 cr\xe9er des visuels qui laissent une impression durable."},"photography-realism":{name:"Photographie et R\xe9alisme",description:"La photographie et le r\xe9alisme se concentrent sur la repr\xe9sentation des sujets avec une pr\xe9cision et un d\xe9tail frappants, refl\xe9tant le monde tel qu'il est. Ce style met l'accent sur la lumi\xe8re naturelle, la composition et les subtilit\xe9s de l'exp\xe9rience humaine, cr\xe9ant des r\xe9cits visuels puissants. Explorez notre collection de suggestions d'images pour inspirer votre g\xe9n\xe9ration d'images de style photographique et am\xe9liorer votre capacit\xe9 \xe0 capturer des moments et des \xe9motions authentiques."},"historical-art-movement":{name:"Mouvement Historique et Artistique",description:"L'art du mouvement historique et artistique explore l'\xe9volution des styles artistiques et des expressions culturelles \xe0 travers l'histoire. Ce style refl\xe8te les influences de divers mouvements, de la Renaissance au Modernisme, montrant comment l'art a fa\xe7onn\xe9 et a \xe9t\xe9 fa\xe7onn\xe9 par les changements soci\xe9taux. Plongez dans notre collection de suggestions d'images pour inspirer votre compr\xe9hension du riche patrimoine de l'art et son dialogue continu avec la cr\xe9ativit\xe9 contemporaine."}},it:{"animation-illustration":{name:"Animazione e Illustrazione",description:"L'animazione e l'illustrazione fondono il movimento dinamico con il dettaglio artistico, creando immagini vibranti che raccontano storie e catturano emozioni. Questo stile d\xe0 vita a immagini statiche, dai personaggi stravaganti ai paesaggi fantastici. Esplora la nostra collezione curata di suggerimenti per immagini per ispirare le tue idee e sbloccare nuove possibilit\xe0 creative."},"sci-fi-fantasy":{name:"Fantascienza e Fantasy",description:"La fantascienza e il fantasy ci trasportano in mondi immaginativi pieni di tecnologia avanzata, creature mitiche e avventure straordinarie. Questo stile mescola elementi futuristici con realismo magico, permettendo una creativit\xe0 illimitata e l'esplorazione dell'ignoto. Immergiti nella nostra collezione di suggerimenti per immagini per stimolare la tua immaginazione e ispirare il tuo prossimo progetto creativo."},perspective:{name:"Prospettiva",description:"La prospettiva si riferisce al modo in cui vediamo e interpretiamo il mondo che ci circonda. Pu\xf2 cambiare il modo in cui comprendiamo e interagiamo con diversi argomenti, offrendo nuove intuizioni e punti di vista. Esplora la nostra collezione di suggerimenti per immagini per ispirare la tua creativit\xe0 e ampliare la tua prospettiva."},"traditional-cultural":{name:"Tradizionale e Culturale",description:"L'arte tradizionale e culturale riflette la ricca storia e le diverse usanze di varie societ\xe0. Questo stile enfatizza la bellezza delle espressioni culturali, dai motivi intricati ai simboli, preservando l'essenza del patrimonio. Esplora la nostra collezione di suggerimenti per immagini per ispirare la tua creativit\xe0 e connetterti con le storie e le tradizioni che plasmano il nostro mondo."},game:{name:"Gioco",description:"L'arte del gioco cattura l'essenza delle esperienze interattive, mescolando creativit\xe0 e tecnologia per creare mondi immersivi. Questo stile abbraccia vari generi, dalle avventure ricche di azione ai puzzle strategici, invitando i giocatori a esplorare, competere e collaborare. Scopri la nostra collezione di suggerimenti per immagini progettati per ispirare la tua generazione di immagini AI legate ai giochi."},"modern-abstract":{name:"Moderno e Astratto",description:"L'arte moderna e astratta sfida le forme convenzionali e incoraggia l'espressione innovativa attraverso colori audaci, forme e concetti. Questo stile enfatizza la creativit\xe0 rispetto al realismo, invitando gli spettatori a interpretare il significato in modi unici. Esplora la nostra collezione di suggerimenti per immagini per ispirare il tuo viaggio artistico e spingere i limiti della tua immaginazione."},"design-commercial":{name:"Design e Commerciale",description:"L'arte del design e commerciale si concentra sulla creazione di immagini visivamente accattivanti per applicazioni commerciali. Questo stile combina principi estetici con strategie di marketing per produrre design accattivanti che catturano l'attenzione e trasmettono un messaggio in modo efficace. Dall'imballaggio dei prodotti vibrante alle campagne pubblicitarie di impatto, l'arte del design e commerciale sfrutta la creativit\xe0 per guidare il successo commerciale. Esplora la nostra collezione di suggerimenti per immagini per ispirare la tua generazione di immagini AI e imparare a creare effetti visivi che lasciano un'impressione duratura."},"photography-realism":{name:"Fotografia e Realismo",description:"La fotografia e il realismo si concentrano sulla rappresentazione dei soggetti con sorprendente accuratezza e dettaglio, riflettendo il mondo cos\xec com'\xe8. Questo stile enfatizza la luce naturale, la composizione e le sottigliezze dell'esperienza umana, creando potenti narrazioni visive. Esplora la nostra collezione di suggerimenti per immagini per ispirare la tua generazione di immagini in stile fotografico e migliorare la tua capacit\xe0 di catturare momenti ed emozioni autentici."},"historical-art-movement":{name:"Movimento Storico e Artistico",description:"L'arte del movimento storico e artistico esplora l'evoluzione degli stili artistici e delle espressioni culturali nel corso della storia. Questo stile riflette le influenze di vari movimenti, dal Rinascimento al Modernismo, mostrando come l'arte abbia plasmato e sia stata plasmata dai cambiamenti sociali. Immergiti nella nostra collezione di suggerimenti per immagini per ispirare la tua comprensione del ricco patrimonio dell'arte e il suo dialogo continuo con la creativit\xe0 contemporanea."}},pt:{"animation-illustration":{name:"Anima\xe7\xe3o e Ilustra\xe7\xe3o",description:"Anima\xe7\xe3o e Ilustra\xe7\xe3o fundem movimento din\xe2mico com detalhes art\xedsticos, criando visuais vibrantes que contam hist\xf3rias e capturam emo\xe7\xf5es. Este estilo d\xe1 vida a imagens est\xe1ticas, desde personagens caprichosos at\xe9 paisagens fant\xe1sticas. Explore nossa cole\xe7\xe3o curada de sugest\xf5es de imagens para inspirar suas ideias e desbloquear novas possibilidades criativas."},"sci-fi-fantasy":{name:"Fic\xe7\xe3o Cient\xedfica e Fantasia",description:"Fic\xe7\xe3o Cient\xedfica e Fantasia nos transporta para mundos imaginativos cheios de tecnologia avan\xe7ada, criaturas m\xedticas e aventuras extraordin\xe1rias. Este estilo mistura elementos futuristas com realismo m\xe1gico, permitindo criatividade ilimitada e explora\xe7\xe3o do desconhecido. Mergulhe em nossa cole\xe7\xe3o de sugest\xf5es de imagens para despertar sua imagina\xe7\xe3o e inspirar seu pr\xf3ximo projeto criativo."},perspective:{name:"Perspectiva",description:"Perspectiva refere-se \xe0 maneira como vemos e interpretamos o mundo ao nosso redor. Pode mudar a forma como entendemos e nos envolvemos com diferentes assuntos, oferecendo novos insights e pontos de vista. Explore nossa cole\xe7\xe3o de sugest\xf5es de imagens para inspirar sua criatividade e ampliar sua perspectiva."},"traditional-cultural":{name:"Tradicional e Cultural",description:"A arte Tradicional e Cultural reflete a rica hist\xf3ria e os diversos costumes de v\xe1rias sociedades. Este estilo enfatiza a beleza das express\xf5es culturais, desde padr\xf5es intrincados at\xe9 motivos simb\xf3licos, preservando a ess\xeancia do patrim\xf4nio. Explore nossa cole\xe7\xe3o de sugest\xf5es de imagens para inspirar sua criatividade e conectar-se com as hist\xf3rias e tradi\xe7\xf5es que moldam nosso mundo."},game:{name:"Jogo",description:"A arte do jogo captura a ess\xeancia das experi\xeancias interativas, misturando criatividade com tecnologia para criar mundos imersivos. Este estilo abrange v\xe1rios g\xeaneros, desde aventuras cheias de a\xe7\xe3o at\xe9 quebra-cabe\xe7as estrat\xe9gicos, convidando os jogadores a explorar, competir e colaborar. Descubra nossa cole\xe7\xe3o de sugest\xf5es de imagens projetadas para inspirar sua gera\xe7\xe3o de imagens de IA relacionadas a jogos."},"modern-abstract":{name:"Moderno e Abstrato",description:"A arte Moderna e Abstrata desafia formas convencionais e incentiva a express\xe3o inovadora atrav\xe9s de cores ousadas, formas e conceitos. Este estilo enfatiza a criatividade sobre o realismo, convidando os espectadores a interpretar o significado de maneiras \xfanicas. Explore nossa cole\xe7\xe3o de sugest\xf5es de imagens para inspirar sua jornada art\xedstica e expandir os limites de sua imagina\xe7\xe3o."},"design-commercial":{name:"Design e Comercial",description:"A arte de Design e Comercial foca em criar imagens visualmente impactantes para aplica\xe7\xf5es comerciais. Este estilo combina princ\xedpios est\xe9ticos com estrat\xe9gias de marketing para produzir designs chamativos que capturam a aten\xe7\xe3o e transmitem uma mensagem de forma eficaz. Desde embalagens de produtos vibrantes at\xe9 campanhas publicit\xe1rias impactantes, a arte de Design e Comercial utiliza a criatividade para impulsionar o sucesso comercial. Explore nossa cole\xe7\xe3o de sugest\xf5es de imagens para inspirar sua gera\xe7\xe3o de imagens de IA e aprender a criar visuais que deixam uma impress\xe3o duradoura."},"photography-realism":{name:"Fotografia e Realismo",description:"Fotografia e Realismo focam em retratar sujeitos com precis\xe3o e detalhes impressionantes, refletindo o mundo como ele \xe9. Este estilo enfatiza luz natural, composi\xe7\xe3o e as sutilezas da experi\xeancia humana, criando narrativas visuais poderosas. Explore nossa cole\xe7\xe3o de sugest\xf5es de imagens para inspirar sua gera\xe7\xe3o de imagens no estilo fotogr\xe1fico e melhorar sua capacidade de capturar momentos e emo\xe7\xf5es aut\xeanticas."},"historical-art-movement":{name:"Movimento Hist\xf3rico e Art\xedstico",description:"A arte do Movimento Hist\xf3rico e Art\xedstico explora a evolu\xe7\xe3o dos estilos art\xedsticos e das express\xf5es culturais ao longo da hist\xf3ria. Este estilo reflete as influ\xeancias de v\xe1rios movimentos, desde o Renascimento at\xe9 o Modernismo, mostrando como a arte moldou e foi moldada pelas mudan\xe7as sociais. Mergulhe em nossa cole\xe7\xe3o de sugest\xf5es de imagens para inspirar sua compreens\xe3o do rico patrim\xf4nio da arte e seu di\xe1logo cont\xednuo com a criatividade contempor\xe2nea."}},ar:{"animation-illustration":{name:"الرسوم المتحركة والتوضيح",description:"تدمج الرسوم المتحركة والتوضيح الحركة الديناميكية مع التفاصيل الفنية، مما يخلق صورًا نابضة بالحياة تروي القصص وتلتقط العواطف. هذا النمط يضفي الحياة على الصور الثابتة، من الشخصيات الخيالية إلى المناظر الطبيعية الخيالية. استكشف مجموعتنا المنسقة من الإرشادات الصورية لإلهام أفكارك وفتح إمكانيات إبداعية جديدة."},"sci-fi-fantasy":{name:"الخيال العلمي والفانتازيا",description:"ينقلنا الخيال العلمي والفانتازيا إلى عوالم خيالية مليئة بالتكنولوجيا المتقدمة والمخلوقات الأسطورية والمغامرات الاستثنائية. يمزج هذا النمط بين العناصر المستقبلية والواقعية السحرية، مما يسمح بإبداع غير محدود واستكشاف المجهول. اغمر نفسك في مجموعتنا من الإرشادات الصورية لإثارة خيالك وإلهام مشروعك الإبداعي التالي."},perspective:{name:"وجهة نظر",description:"تشير وجهة النظر إلى الطريقة التي نرى بها العالم من حولنا ونفسره. يمكن أن تغير كيفية فهمنا والتفاعل مع الموضوعات المختلفة، مما يوفر رؤى ووجهات نظر جديدة. استكشف مجموعتنا من الإرشادات الصورية لإلهام إبداعك وتوسيع وجهة نظرك."},"traditional-cultural":{name:"التقليدي والثقافي",description:"يعكس الفن التقليدي والثقافي التاريخ الغني والعادات المتنوعة لمختلف المجتمعات. يؤكد هذا النمط على جمال التعبيرات الثقافية، من الأنماط المعقدة إلى الرموز الرمزية، مما يحافظ على جوهر التراث. استكشف مجموعتنا من الإرشادات الصورية لإلهام إبداعك والتواصل مع القصص والتقاليد التي تشكل عالمنا."},game:{name:"اللعبة",description:"يلتقط فن اللعبة جوهر التجارب التفاعلية، ويمزج بين الإبداع والتكنولوجيا لخلق عوالم غامرة. يشمل هذا النمط أنواعًا مختلفة، من المغامرات المليئة بالحركة إلى الألغاز الاستراتيجية، ويدعو اللاعبين لاستكشاف والتنافس والتعاون. اكتشف مجموعتنا من الإرشادات الصورية المصممة لإلهام توليد الصور المتعلقة بالذكاء الاصطناعي للعبة."},"modern-abstract":{name:"الحديث والتجريدي",description:"يتحدى الفن الحديث والتجريدي الأشكال التقليدية ويشجع على التعبير المبتكر من خلال الألوان الجريئة والأشكال والمفاهيم. يؤكد هذا النمط على الإبداع على الواقعية، ويدعو المشاهدين لتفسير المعنى بطرق فريدة. استكشف مجموعتنا من الإرشادات الصورية لإلهام رحلتك الفنية ودفع حدود خيالك."},"design-commercial":{name:"التصميم والتجاري",description:"يركز فن التصميم والتجاري على إنشاء صور جذابة بصريًا للتطبيقات التجارية. يجمع هذا النمط بين المبادئ الجمالية واستراتيجيات التسويق لإنتاج تصاميم ملفتة للنظر تجذب الانتباه وتنقل الرسالة بفعالية. من تغليف المنتجات النابض بالحياة إلى الحملات الإعلانية المؤثرة، يستفيد فن التصميم والتجاري من الإبداع لتحقيق النجاح التجاري. استكشف مجموعتنا من الإرشادات الصورية لإلهام توليد الصور المتعلقة بالذكاء الاصطناعي وتعلم كيفية إنشاء تأثيرات بصرية تترك انطباعًا دائمًا."},"photography-realism":{name:"التصوير الفوتوغرافي والواقعية",description:"يركز التصوير الفوتوغرافي والواقعية على تصوير الموضوعات بدقة وتفاصيل مذهلة، مما يعكس العالم كما هو. يؤكد هذا النمط على الضوء الطبيعي والتكوين ودقة التجربة الإنسانية، مما يخلق روايات بصرية قوية. استكشف مجموعتنا من الإرشادات الصورية لإلهام توليد الصور بأسلوب التصوير الفوتوغرافي وتعزيز قدرتك على التقاط اللحظات والعواطف الأصيلة."},"historical-art-movement":{name:"الحركة الفنية التاريخية",description:"يستكشف فن الحركة الفنية التاريخية تطور الأساليب الفنية والتعبيرات الثقافية عبر التاريخ. يعكس هذا النمط تأثيرات الحركات المختلفة، من عصر النهضة إلى الحداثة، ويظهر كيف شكل الفن التغيرات الاجتماعية وتأثر بها. اغمر نفسك في مجموعتنا من الإرشادات الصورية لإلهام فهمك للتراث الفني الغني وحواره المستمر مع الإبداع المعاصر."}},ru:{"animation-illustration":{name:"Анимация и Иллюстрация",description:"Анимация и Иллюстрация объединяют динамическое движение с художественными деталями, создавая яркие визуальные эффекты, которые рассказывают истории и передают эмоции. Этот стиль оживляет статичные изображения, от причудливых персонажей до фантастических пейзажей. Исследуйте нашу курированную коллекцию подсказок для изображений, чтобы вдохновить ваши идеи и открыть новые творческие возможности."},"sci-fi-fantasy":{name:"Научная фантастика и Фэнтези",description:"Научная фантастика и Фэнтези переносят нас в воображаемые миры, наполненные передовыми технологиями, мифическими существами и необыкновенными приключениями. Этот стиль сочетает футуристические элементы с магическим реализмом, позволяя безграничное творчество и исследование неизвестного. Погрузитесь в нашу коллекцию подсказок для изображений, чтобы разжечь ваше воображение и вдохновить ваш следующий творческий проект."},perspective:{name:"Перспектива",description:"Перспектива относится к тому, как мы видим и интерпретируем окружающий нас мир. Она может изменить наше понимание и взаимодействие с различными темами, предлагая новые идеи и точки зрения. Исследуйте нашу коллекцию подсказок для изображений, чтобы вдохновить ваше творчество и расширить вашу перспективу."},"traditional-cultural":{name:"Традиционное и Культурное",description:"Традиционное и Культурное искусство отражает богатую историю и разнообразные обычаи различных обществ. Этот стиль подчеркивает красоту культурных выражений, от сложных узоров до символических мотивов, сохраняя суть наследия. Исследуйте нашу коллекцию подсказок для изображений, чтобы вдохновить ваше творчество и связаться с историями и традициями, которые формируют наш мир."},game:{name:"Игра",description:"Игровое искусство захватывает суть интерактивных впечатлений, объединяя творчество с технологиями для создания захватывающих миров. Этот стиль охватывает различные жанры, от насыщенных действиями приключений до стратегических головоломок, приглашая игроков исследовать, соревноваться и сотрудничать. Откройте для себя нашу коллекцию подсказок для изображений, разработанных для вдохновения вашего игрового ИИ-генерации изображений."},"modern-abstract":{name:"Современное и Абстрактное",description:"Современное и Абстрактное искусство бросает вызов традиционным формам и поощряет инновационное выражение через смелые цвета, формы и концепции. Этот стиль подчеркивает творчество над реализмом, приглашая зрителей интерпретировать смысл уникальными способами. Исследуйте нашу коллекцию подсказок для изображений, чтобы вдохновить ваше художественное путешествие и расширить границы вашего воображения."},"design-commercial":{name:"Дизайн и Коммерческое",description:"Дизайн и Коммерческое искусство сосредоточено на создании визуально впечатляющих изображений для коммерческих приложений. Этот стиль сочетает эстетические принципы с маркетинговыми стратегиями для создания привлекательных дизайнов, которые привлекают внимание и эффективно передают сообщение. От яркой упаковки продуктов до мощных рекламных кампаний, Дизайн и Коммерческое искусство использует творчество для достижения коммерческого успеха. Исследуйте нашу коллекцию подсказок для изображений, чтобы вдохновить ваше ИИ-генерацию изображений и научиться создавать визуальные эффекты, которые оставляют неизгладимое впечатление."},"photography-realism":{name:"Фотография и Реализм",description:"Фотография и Реализм сосредоточены на точном и детальном изображении объектов, отражая мир таким, какой он есть. Этот стиль подчеркивает естественный свет, композицию и тонкости человеческого опыта, создавая мощные визуальные повествования. Исследуйте нашу коллекцию подсказок для изображений, чтобы вдохновить ваше фотографическое ИИ-генерацию изображений и улучшить вашу способность захватывать подлинные моменты и эмоции."},"historical-art-movement":{name:"Историческое и Художественное Движение",description:"Искусство Исторического и Художественного Движения исследует эволюцию художественных стилей и культурных выражений на протяжении истории. Этот стиль отражает влияние различных движений, от Ренессанса до Модернизма, показывая, как искусство формировало и было сформировано социальными изменениями. Погрузитесь в нашу коллекцию подсказок для изображений, чтобы вдохновить ваше понимание богатого наследия искусства и его продолжающегося диалога с современным творчеством."}},bn:{"animation-illustration":{name:"অ্যানিমেশন ও ইলাস্ট্রেশন",description:"অ্যানিমেশন ও ইলাস্ট্রেশন গতিশীল আন্দোলনকে শিল্পকর্মের বিশদ বিবরণের সাথে মিশ্রিত করে, যা গল্প বলে এবং আবেগকে ধরে রাখে। এই শৈলী স্থির চিত্রগুলিকে জীবন্ত করে তোলে, কল্পনাপ্রসূত চরিত্র থেকে শুরু করে কল্পনাপ্রসূত প্রাকৃতিক দৃশ্য পর্যন্ত। আমাদের কিউরেটেড চিত্র নির্দেশনার সংগ্রহটি অন্বেষণ করুন, আপনার ধারণাগুলিকে অনুপ্রাণিত করতে এবং নতুন সৃজনশীল সম্ভাবনাগুলি উন্মোচন করতে।"},"sci-fi-fantasy":{name:"বিজ্ঞান কল্পকাহিনী ও ফ্যান্টাসি",description:"বিজ্ঞান কল্পকাহিনী ও ফ্যান্টাসি আমাদেরকে কল্পনাপ্রসূত জগতে নিয়ে যায়, যা উন্নত প্রযুক্তি, পৌরাণিক প্রাণী এবং অসাধারণ অভিযানে পূর্ণ। এই শৈলী ভবিষ্যত উপাদানগুলিকে যাদুকরী বাস্তবতার সাথে মিশ্রিত করে, সীমাহীন সৃজনশীলতা এবং অজানাকে অন্বেষণ করার সুযোগ দেয়। আমাদের চিত্র নির্দেশনার সংগ্রহে ডুব দিন, আপনার কল্পনাকে উদ্দীপিত করতে এবং আপনার পরবর্তী সৃজনশীল প্রচেষ্টাকে অনুপ্রাণিত করতে।"},perspective:{name:"দৃষ্টিভঙ্গি",description:"দৃষ্টিভঙ্গি বলতে আমরা যেভাবে আমাদের চারপাশের বিশ্বকে দেখি এবং ব্যাখ্যা করি তা বোঝায়। এটি বিভিন্ন বিষয়ের প্রতি আমাদের বোঝাপড়া এবং সম্পৃক্ততা পরিবর্তন করতে পারে, নতুন অন্তর্দৃষ্টি এবং দৃষ্টিভঙ্গি প্রদান করে। আমাদের চিত্র নির্দেশনার সংগ্রহটি অন্বেষণ করুন, আপনার সৃজনশীলতাকে অনুপ্রাণিত করতে এবং আপনার দৃষ্টিভঙ্গি প্রসারিত করতে।"},"traditional-cultural":{name:"প্রথাগত ও সাংস্কৃতিক",description:"প্রথাগত ও সাংস্কৃতিক শিল্প বিভিন্ন সমাজের সমৃদ্ধ ইতিহাস এবং বৈচিত্র্যময় রীতিনীতিকে প্রতিফলিত করে। এই শৈলী সাংস্কৃতিক প্রকাশের সৌন্দর্যকে জোর দেয়, জটিল নিদর্শন থেকে প্রতীকী মোটিফ পর্যন্ত, ঐতিহ্যের সারমর্ম সংরক্ষণ করে। আমাদের চিত্র নির্দেশনার সংগ্রহটি অন্বেষণ করুন, আপনার সৃজনশীলতাকে অনুপ্রাণিত করতে এবং আমাদের বিশ্বকে গঠনকারী গল্প এবং ঐতিহ্যের সাথে সংযোগ করতে।"},game:{name:"গেম",description:"গেম শিল্প ইন্টারেক্টিভ অভিজ্ঞতার সারমর্মকে ধারণ করে, প্রযুক্তির সাথে সৃজনশীলতাকে মিশ্রিত করে নিমজ্জিত জগৎ তৈরি করে। এই শৈলী বিভিন্ন ধরণের অন্তর্ভুক্ত করে, অ্যাকশন-প্যাকড অ্যাডভেঞ্চার থেকে কৌশলগত ধাঁধা পর্যন্ত, খেলোয়াড়দের অন্বেষণ, প্রতিযোগিতা এবং সহযোগিতার জন্য আমন্ত্রণ জানায়। গেম সম্পর্কিত এআই চিত্র প্রজন্মকে অনুপ্রাণিত করার জন্য ডিজাইন করা আমাদের চিত্র নির্দেশনার সংগ্রহটি আবিষ্কার করুন।"},"modern-abstract":{name:"আধুনিক ও বিমূর্ত",description:"আধুনিক ও বিমূর্ত শিল্প প্রচলিত ফর্মগুলিকে চ্যালেঞ্জ করে এবং সাহসী রঙ, আকার এবং ধারণার মাধ্যমে উদ্ভাবনী প্রকাশকে উত্সাহিত করে। এই শৈলী বাস্তবতার উপর সৃজনশীলতাকে জোর দেয়, দর্শকদের অনন্য উপায়ে অর্থ ব্যাখ্যা করার জন্য আমন্ত্রণ জানায়। আমাদের চিত্র নির্দেশনার সংগ্রহটি অন্বেষণ করুন, আপনার শিল্প যাত্রাকে অনুপ্রাণিত করতে এবং আপনার কল্পনার সীমাগুলিকে ঠেলে দিতে।"},"design-commercial":{name:"ডিজাইন ও বাণিজ্যিক",description:"ডিজাইন ও বাণিজ্যিক শিল্প বাণিজ্যিক অ্যাপ্লিকেশনের জন্য ভিজ্যুয়ালি আকর্ষণীয় চিত্র তৈরি করার উপর দৃষ্টি নিবদ্ধ করে। এই শৈলী বিপণন কৌশলগুলির সাথে নান্দনিক নীতিগুলিকে একত্রিত করে, দৃষ্টি আকর্ষণ করে এবং কার্যকরভাবে একটি বার্তা প্রেরণ করে এমন আকর্ষণীয় ডিজাইন তৈরি করে। প্রাণবন্ত পণ্য প্যাকেজিং থেকে প্রভাবশালী বিজ্ঞাপন প্রচারাভিযান পর্যন্ত, ডিজাইন ও বাণিজ্যিক শিল্প সৃজনশীলতাকে কাজে লাগিয়ে বাণিজ্যিক সাফল্য অর্জন করে। আমাদের চিত্র নির্দেশনার সংগ্রহটি অন্বেষণ করুন, আপনার এআই চিত্র প্রজন্মকে অনুপ্রাণিত করতে এবং দীর্ঘস্থায়ী প্রভাব ফেলে এমন ভিজ্যুয়াল তৈরি করতে শিখতে।"},"photography-realism":{name:"ফটোগ্রাফি ও বাস্তববাদ",description:"ফটোগ্রাফি ও বাস্তববাদ বিষয়গুলিকে চমকপ্রদ নির্ভুলতা এবং বিশদ সহ চিত্রিত করার উপর দৃষ্টি নিবদ্ধ করে, বিশ্বকে যেমনটি তেমন প্রতিফলিত করে। এই শৈলী প্রাকৃতিক আলো, রচনা এবং মানব অভিজ্ঞতার সূক্ষ্মতাগুলিকে জোর দেয়, শক্তিশালী ভিজ্যুয়াল বর্ণনা তৈরি করে। আমাদের চিত্র নির্দেশনার সংগ্রহটি অন্বেষণ করুন, আপনার ফটোগ্রাফি শৈলী চিত্র প্রজন্মকে অনুপ্রাণিত করতে এবং প্রামাণিক মুহূর্ত এবং আবেগগুলি ক্যাপচার করার আপনার ক্ষমতাকে উন্নত করতে।"},"historical-art-movement":{name:"ঐতিহাসিক ও শিল্প আন্দোলন",description:"ঐতিহাসিক ও শিল্প আন্দোলন শিল্প ইতিহাস জুড়ে শিল্প শৈলী এবং সাংস্কৃতিক প্রকাশের বিবর্তন অন্বেষণ করে। এই শৈলী বিভিন্ন আন্দোলনের প্রভাব প্রতিফলিত করে, রেনেসাঁ থেকে আধুনিকতাবাদ পর্যন্ত, দেখায় যে কীভাবে শিল্প সামাজিক পরিবর্তনকে আকার দিয়েছে এবং এটি দ্বারা আকার পেয়েছে। আমাদের চিত্র নির্দেশনার সংগ্রহে ডুব দিন, শিল্পের সমৃদ্ধ ঐতিহ্য এবং সমসাময়িক সৃজনশীলতার সাথে এর চলমান সংলাপের আপনার বোঝাপড়াকে অনুপ্রাণিত করতে।"}},ja:{"animation-illustration":{name:"アニメーションとイラストレーション",description:"アニメーションとイラストレーションは、動的な動きと芸術的なディテールを融合させ、物語を語り、感情を捉える鮮やかなビジュアルを作り出します。このスタイルは、静止画像に命を吹き込み、風変わりなキャラクターから幻想的な風景までを描きます。私たちの厳選された画像プロンプトのコレクションを探索して、あなたのアイデアにインスピレーションを与え、新しい創造的な可能性を開きましょう。"},"sci-fi-fantasy":{name:"サイエンスフィクションとファンタジー",description:"サイエンスフィクションとファンタジーは、先進技術、神話上の生物、そして非凡な冒険に満ちた想像上の世界へと私たちを連れて行きます。このスタイルは、未来的な要素と魔法のリアリズムを組み合わせ、無限の創造性と未知の探求を可能にします。私たちの画像プロンプトのコレクションに没頭して、あなたの想像力を刺激し、次の創造的なプロジェクトにインスピレーションを与えましょう。"},perspective:{name:"視点",description:"視点とは、私たちが周囲の世界をどのように見て解釈するかを指します。これは、さまざまな主題に対する私たちの理解と関わり方を変え、新しい洞察と視点を提供します。私たちの画像プロンプトのコレクションを探索して、あなたの創造性にインスピレーションを与え、視点を広げましょう。"},"traditional-cultural":{name:"伝統と文化",description:"伝統と文化のアートは、さまざまな社会の豊かな歴史と多様な習慣を反映しています。このスタイルは、複雑なパターンから象徴的なモチーフまで、文化的表現の美しさを強調し、遺産の本質を保存します。私たちの画像プロンプトのコレクションを探索して、あなたの創造性にインスピレーションを与え、私たちの世界を形作る物語と伝統とつながりましょう。"},game:{name:"ゲーム",description:"ゲームアートは、インタラクティブな体験の本質を捉え、創造性と技術を融合させて没入型の世界を作り出します。このスタイルは、アクション満載の冒険から戦略的なパズルまで、さまざまなジャンルを網羅しており、プレイヤーに探索、競争、協力を呼びかけます。ゲーム関連のAI画像生成にインスピレーションを与えるために設計された私たちの画像プロンプトのコレクションを発見しましょう。"},"modern-abstract":{name:"モダンとアブストラクト",description:"モダンとアブストラクトアートは、伝統的な形式に挑戦し、大胆な色、形、概念を通じて革新的な表現を奨励します。このスタイルは、リアリズムよりも創造性を強調し、視聴者に独自の方法で意味を解釈するよう招待します。私たちの画像プロンプトのコレクションを探索して、あなたのアートの旅にインスピレーションを与え、想像力の限界を押し広げましょう。"},"design-commercial":{name:"デザインと商業",description:"デザインと商業アートは、商業用途のために視覚的に魅力的な画像を作成することに焦点を当てています。このスタイルは、美的原則とマーケティング戦略を組み合わせて、注目を集め、効果的にメッセージを伝える魅力的なデザインを作り出します。鮮やかな製品パッケージから影響力のある広告キャンペーンまで、デザインと商業アートは創造性を活用して商業的成功を達成します。私たちの画像プロンプトのコレクションを探索して、AI画像生成にインスピレーションを与え、永続的な印象を残すビジュアルを作成する方法を学びましょう。"},"photography-realism":{name:"写真とリアリズム",description:"写真とリアリズムは、被写体を正確かつ詳細に描写し、世界をそのまま反映することに焦点を当てています。このスタイルは、自然光、構図、人間の経験の微妙さを強調し、強力な視覚的物語を作り出します。私たちの画像プロンプトのコレクションを探索して、写真スタイルのAI画像生成にインスピレーションを与え、真実の瞬間と感情を捉える能力を向上させましょう。"},"historical-art-movement":{name:"歴史的な芸術運動",description:"歴史的な芸術運動のアートは、歴史を通じて芸術スタイルと文化的表現の進化を探求します。このスタイルは、ルネサンスからモダニズムまで、さまざまな運動の影響を反映し、芸術がどのように社会的変化を形作り、またそれによって形作られたかを示します。私たちの画像プロンプトのコレクションに没頭して、豊かな芸術遺産と現代の創造性との継続的な対話に対する理解を深めましょう。"}},ko:{"animation-illustration":{name:"애니메이션 및 일러스트레이션",description:"애니메이션 및 일러스트레이션은 역동적인 움직임과 예술적 디테일을 결합하여 이야기를 전달하고 감정을 포착하는 생생한 비주얼을 만듭니다. 이 스타일은 정적인 이미지를 생동감 있게 만들며, 기발한 캐릭터부터 환상적인 풍경까지 다양한 장면을 담아냅니다. 우리의 큐레이션된 이미지 프롬프트 컬렉션을 탐색하여 아이디어에 영감을 주고 새로운 창의적 가능성을 열어보세요."},"sci-fi-fantasy":{name:"공상 과학 및 판타지",description:"공상 과학 및 판타지는 첨단 기술, 신화적 생물, 그리고 비범한 모험으로 가득 찬 상상 속 세계로 우리를 안내합니다. 이 스타일은 미래적인 요소와 마법적 사실주의를 결합하여 무한한 창의성과 미지의 탐구를 가능하게 합니다. 우리의 이미지 프롬프트 컬렉션에 몰입하여 상상력을 자극하고 다음 창의적 프로젝트에 영감을 불어넣어보세요."},perspective:{name:"관점",description:"관점은 우리가 주변 세계를 보는 방식과 해석하는 방식을 의미합니다. 이는 우리가 다양한 주제를 이해하고 참여하는 방식을 변화시킬 수 있으며, 새로운 통찰력과 관점을 제공합니다. 우리의 이미지 프롬프트 컬렉션을 탐색하여 창의력을 자극하고 관점을 넓히세요."},"traditional-cultural":{name:"전통 및 문화",description:"전통 및 문화 예술은 다양한 사회의 풍부한 역사와 다양한 관습을 반영합니다. 이 스타일은 복잡한 패턴부터 상징적인 모티프까지 문화적 표현의 아름다움을 강조하며, 유산의 본질을 보존합니다. 우리의 이미지 프롬프트 컬렉션을 탐색하여 창의력에 영감을 주고 우리 세계를 형성하는 이야기와 전통과 연결해보세요."},game:{name:"게임",description:"게임 예술은 창의성과 기술을 결합하여 몰입형 세계를 창조하며, 인터랙티브 경험의 본질을 포착합니다. 이 스타일은 액션이 가득한 모험부터 전략적 퍼즐까지 다양한 장르를 포괄하며, 플레이어에게 탐험, 경쟁, 협력을 초대합니다. 게임 관련 AI 이미지 생성을 위한 영감을 주기 위해 설계된 우리의 이미지 프롬프트 컬렉션을 발견해보세요."},"modern-abstract":{name:"현대 및 추상",description:"현대 및 추상 예술은 전통적인 형식을 도전하고 대담한 색상, 형태 및 개념을 통해 혁신적인 표현을 장려합니다. 이 스타일은 현실주의보다 창의성을 강조하며, 관객에게 독특한 방식으로 의미를 해석하도록 초대합니다. 우리의 이미지 프롬프트 컬렉션을 탐색하여 예술 여정에 영감을 주고 상상력의 한계를 넓혀보세요."},"design-commercial":{name:"디자인 및 상업",description:"디자인 및 상업 예술은 상업적 용도를 위해 시각적으로 매력적인 이미지를 만드는 데 중점을 둡니다. 이 스타일은 미적 원칙과 마케팅 전략을 결합하여 주목을 끌고 효과적으로 메시지를 전달하는 매력적인 디자인을 만듭니다. 생생한 제품 포장부터 영향력 있는 광고 캠페인까지, 디자인 및 상업 예술은 창의성을 활용하여 상업적 성공을 달성합니다. 우리의 이미지 프롬프트 컬렉션을 탐색하여 AI 이미지 생성을 위한 영감을 얻고 지속적인 인상을 남기는 비주얼을 만드는 방법을 배워보세요."},"photography-realism":{name:"사진 및 사실주의",description:"사진 및 사실주의는 주제를 정확하고 세밀하게 묘사하여 세계를 있는 그대로 반영하는 데 중점을 둡니다. 이 스타일은 자연광, 구성, 인간 경험의 미묘함을 강조하여 강력한 시각적 이야기를 만들어냅니다. 우리의 이미지 프롬프트 컬렉션을 탐색하여 사진 스타일의 AI 이미지 생성을 위한 영감을 얻고 진정한 순간과 감정을 포착하는 능력을 향상시켜보세요."},"historical-art-movement":{name:"역사적 예술 운동",description:"역사적 예술 운동 예술은 역사 전반에 걸쳐 예술 스타일과 문화적 표현의 진화를 탐구합니다. 이 스타일은 르네상스부터 모더니즘까지 다양한 운동의 영향을 반영하여 예술이 사회적 변화를 어떻게 형성하고 형성되었는지를 보여줍니다. 우리의 이미지 프롬프트 컬렉션에 몰입하여 풍부한 예술 유산과 현대 창의성과의 지속적인 대화에 대한 이해를 깊게 해보세요."}},id:{"animation-illustration":{name:"Animasi dan Ilustrasi",description:"Animasi dan Ilustrasi menggabungkan gerakan dinamis dengan detail artistik, menciptakan visual yang hidup yang menceritakan kisah dan menangkap emosi. Gaya ini menghidupkan gambar diam, dari karakter aneh hingga pemandangan fantastis. Jelajahi koleksi prompt gambar yang dikurasi kami untuk menginspirasi ide-ide Anda dan membuka kemungkinan kreatif baru."},"sci-fi-fantasy":{name:"Fiksi Ilmiah dan Fantasi",description:"Fiksi Ilmiah dan Fantasi membawa kita ke dunia imajinatif yang penuh dengan teknologi canggih, makhluk mitos, dan petualangan luar biasa. Gaya ini menggabungkan elemen futuristik dengan realisme magis, memungkinkan kreativitas tanpa batas dan eksplorasi yang tidak diketahui. Tenggelamkan diri Anda dalam koleksi prompt gambar kami untuk membangkitkan imajinasi Anda dan menginspirasi proyek kreatif Anda berikutnya."},perspective:{name:"Perspektif",description:"Perspektif mengacu pada cara kita melihat dan menafsirkan dunia di sekitar kita. Ini dapat mengubah cara kita memahami dan terlibat dengan berbagai subjek, menawarkan wawasan dan sudut pandang baru. Jelajahi koleksi prompt gambar kami untuk menginspirasi kreativitas Anda dan memperluas perspektif Anda."},"traditional-cultural":{name:"Tradisional dan Budaya",description:"Seni tradisional dan budaya mencerminkan sejarah yang kaya dan kebiasaan beragam dari berbagai masyarakat. Gaya ini menekankan keindahan ekspresi budaya, dari pola yang rumit hingga motif simbolis, menjaga esensi warisan. Jelajahi koleksi prompt gambar kami untuk menginspirasi kreativitas Anda dan terhubung dengan cerita dan tradisi yang membentuk dunia kita."},game:{name:"Permainan",description:"Seni permainan menangkap esensi pengalaman interaktif, menggabungkan kreativitas dengan teknologi untuk menciptakan dunia yang imersif. Gaya ini mencakup berbagai genre, dari petualangan penuh aksi hingga teka-teki strategis, mengundang pemain untuk menjelajah, bersaing, dan berkolaborasi. Temukan koleksi prompt gambar kami yang dirancang untuk menginspirasi generasi gambar AI terkait permainan Anda."},"modern-abstract":{name:"Modern dan Abstrak",description:"Seni modern dan abstrak menantang bentuk tradisional dan mendorong ekspresi inovatif melalui warna, bentuk, dan konsep yang berani. Gaya ini menekankan kreativitas di atas realisme, mengundang pemirsa untuk menafsirkan makna dengan cara yang unik. Jelajahi koleksi prompt gambar kami untuk menginspirasi perjalanan seni Anda dan mendorong batas imajinasi Anda."},"design-commercial":{name:"Desain dan Komersial",description:"Seni desain dan komersial berfokus pada pembuatan gambar yang menarik secara visual untuk aplikasi komersial. Gaya ini menggabungkan prinsip estetika dengan strategi pemasaran untuk menghasilkan desain yang menarik perhatian dan menyampaikan pesan secara efektif. Dari kemasan produk yang hidup hingga kampanye iklan yang berdampak, seni desain dan komersial memanfaatkan kreativitas untuk mencapai kesuksesan komersial. Jelajahi koleksi prompt gambar kami untuk menginspirasi generasi gambar AI Anda dan belajar cara membuat visual yang meninggalkan kesan abadi."},"photography-realism":{name:"Fotografi dan Realisme",description:"Fotografi dan realisme berfokus pada penggambaran subjek dengan akurasi dan detail yang menakjubkan, mencerminkan dunia apa adanya. Gaya ini menekankan cahaya alami, komposisi, dan nuansa pengalaman manusia, menciptakan narasi visual yang kuat. Jelajahi koleksi prompt gambar kami untuk menginspirasi generasi gambar AI gaya fotografi Anda dan meningkatkan kemampuan Anda untuk menangkap momen dan emosi yang otentik."},"historical-art-movement":{name:"Gerakan Seni Sejarah",description:"Seni gerakan seni sejarah mengeksplorasi evolusi gaya seni dan ekspresi budaya sepanjang sejarah. Gaya ini mencerminkan pengaruh berbagai gerakan, dari Renaisans hingga Modernisme, menunjukkan bagaimana seni membentuk dan dibentuk oleh perubahan sosial. Tenggelamkan diri Anda dalam koleksi prompt gambar kami untuk menginspirasi pemahaman Anda tentang warisan seni yang kaya dan dialog berkelanjutan dengan kreativitas kontemporer."}}},t=Object.entries(n.en).reduce((e,i)=>{let[a,n]=i;return e[a]={name:n.name,description:n.description},e},{});function r(e){var i;let a=arguments.length>1&&void 0!==arguments[1]?arguments[1]:"en",t=(null===(i=n[a])||void 0===i?void 0:i[e])||n.en[e];return{name:t.name,description:t.description}}function s(e){var i,a;let t=arguments.length>1&&void 0!==arguments[1]?arguments[1]:"en";return(null===(a=n[t])||void 0===a?void 0:null===(i=a[e])||void 0===i?void 0:i.name)||e}function o(){return Object.keys(t)}}}]);